goog.provide("goog.debug.FpsDisplayTest");goog.setTestOnly("goog.debug.FpsDisplayTest");goog.require("goog.Timer");goog.require("goog.debug.FpsDisplay");goog.require("goog.testing.TestCase");goog.require("goog.testing.jsunit");var fpsDisplay;function shouldRunTests(){return!/closure\/goog\/ui/.test(location.pathname)}function setUpPage(){goog.testing.TestCase.getActiveTestCase().promiseTimeout=5e3}function setUp(){fpsDisplay=new goog.debug.FpsDisplay}function tearDown(){goog.dispose(fpsDisplay)}function testRendering(){fpsDisplay.render();var elem=fpsDisplay.getElement();assertHTMLEquals("",elem.innerHTML);return goog.Timer.promise(2e3).then(function(){var fps=parseInt(elem.innerHTML,10);assertTrue("FPS of "+fps+" should be non-negative",0<=fps);assertTrue("FPS of "+fps+" too big",1e3>fps)})}